import UsuarioForm from "@/components/UsuarioForm.vue";
import { api } from "@/services.js";
export default {
  name: "UsuarioEditar",
  components: {
    UsuarioForm: UsuarioForm
  },
  data: function data() {
    return {
      erros: []
    };
  },
  methods: {
    atualizarUsuario: function atualizarUsuario() {
      var _this = this;

      this.erros = [];
      api.put("/usuario", this.$store.state.usuario).then(function () {
        _this.$store.dispatch("getUsuario");

        _this.$router.push({
          name: "usuario"
        });
      }).catch(function (error) {
        _this.erros.push(error.response.data.message);
      });
    }
  },
  created: function created() {
    document.title = "Usuário | Editar";
  }
};
